pragma solidity >=0.4.21 <0.6.0;

contract HistoryUserManagementStorage {
    struct HistoryUserManagement {
        address userAddress;
        string userId;
        string fullName;
        string email;
        string password;
        string gender;
        string dateOfBirth;
        string userAddr;

        string createdTime;
        string modifiedTime;
        string idCardNo;
        string idCardIssuePlace;

        string phoneNumber;
        string job;
        string isLocked;
        uint256 index;
    }

    mapping(address => HistoryUserManagement) historyUserManagementStructs;

    address[] userIndex;

    //eventInsert
    event AddHistoryUserManagementEvent(
        address _userAddress, string _userId, string _fullName, string _email,
        string _password, string _gender, string _dateOfBirth);

    event AddHistoryUserManagementAdditionEvent(
        address _userAddress, string _isLocked, string _createdTime,
        string _modifiedTime, string _idCardNo, string _idCardIssuePlace);

    event AddHistoryUserManagementAdditionFlusEvent(
        address _userAddress, string _phoneNumber, string _job, string _userAddr, uint256 _index);

    //eventUpdate
    event AddUpdateHistoryUserManagementEven(
        address _userAddress, string _userId, string _fullName, string _email,
        string _password, string _gender, string _dateOfBirth);
    event AddUpdateHistoryUserManagementAdditionEven(
        address _userAddress, string _isLocked, string _modifiedTime,
        string _createdTime, string _idCardNo, string _idCardIssuePlace);
    event AddUpdateHistoryUserManagementAdditionFlusEven(
        address _userAddress, string _phoneNumber, string _job, string _userAddr, uint256 _index);

    //eventDelete
    event AddDeleteHistoryUserManagement(
        address _userAddress,
        uint256 index);

    function isUser(address _userAddress) public view returns(bool isIndeed) {
      if(userIndex.length == 0) return false;
      return (userIndex[historyUserManagementStructs[_userAddress].index] == _userAddress);
    }

    function addInsertUserHistory(
      address _userAddress,
      string memory _userId,
      string memory _fullName,
      string memory _email,
      string memory _password,
      string memory _gender,
      string memory _dateOfBirth
      )
      public returns(uint256 index){
      //if(isUser(_userAddress)) revert('throw');
      historyUserManagementStructs[_userAddress].userId = _userId;
      historyUserManagementStructs[_userAddress].fullName = _fullName;
      historyUserManagementStructs[_userAddress].email = _email;
      historyUserManagementStructs[_userAddress].password = _password;
      historyUserManagementStructs[_userAddress].gender = _gender;
      historyUserManagementStructs[_userAddress].dateOfBirth = _dateOfBirth;
      emit AddHistoryUserManagementEvent(_userAddress, _userId, _fullName, _email, _password, _gender, _dateOfBirth);

      return userIndex.length-1;
    }

    function addInsertUserHistoryDetail(
        address _userAddress,
        string memory _isLocked,
        string memory _createdTime,
        string memory _modifiedTime,
        string  memory _idCardNo,
        string  memory _idCardIssuePlace
        )
        public returns(uint256 index){
        historyUserManagementStructs[_userAddress].isLocked = _isLocked;
        historyUserManagementStructs[_userAddress].createdTime = _createdTime;
        historyUserManagementStructs[_userAddress].modifiedTime = _modifiedTime;
        historyUserManagementStructs[_userAddress].idCardNo = _idCardNo;
        historyUserManagementStructs[_userAddress].idCardIssuePlace = _idCardIssuePlace;

        emit AddHistoryUserManagementAdditionEvent(_userAddress, _isLocked, _createdTime, _modifiedTime, _idCardNo, _idCardIssuePlace);
        return userIndex.length-1;
    }

    function insertUserHistoryDetailFlus(
        address _userAddress,
        string memory _phoneNumber,
        string  memory _job,
        string  memory _userAddr
        )
        public returns(uint256 index){
        // if(isUser(_userAddress)) revert('throw');
        historyUserManagementStructs[_userAddress].phoneNumber = _phoneNumber;
        historyUserManagementStructs[_userAddress].job = _job;
        historyUserManagementStructs[_userAddress].userAddr = _userAddr;
        historyUserManagementStructs[_userAddress].index = userIndex.push(_userAddress)-1;
        emit AddHistoryUserManagementAdditionFlusEvent(
            _userAddress,
            _phoneNumber,
            _job,
            _userAddr,
            historyUserManagementStructs[_userAddress].index);
        return userIndex.length-1;
    }

    function addDeleteUser(address _userAddress) public returns(uint256 index){
        // if(!isUser(_userAddress)) revert('throw');
        uint256 rowToDelete = historyUserManagementStructs[_userAddress].index;
        address keyToMove = userIndex[userIndex.length-1];
        userIndex[rowToDelete] = keyToMove; //vi tri can delete = vi tri cuoi ds
        historyUserManagementStructs[keyToMove].index = rowToDelete;

        userIndex.length--;
        emit AddDeleteHistoryUserManagement(
            _userAddress,
            rowToDelete);

        emit AddUpdateHistoryUserManagementEven(
            keyToMove,
            historyUserManagementStructs[keyToMove].userId,
            historyUserManagementStructs[keyToMove].fullName,
            historyUserManagementStructs[keyToMove].email,
            historyUserManagementStructs[keyToMove].password,
            historyUserManagementStructs[keyToMove].gender,
            historyUserManagementStructs[keyToMove].dateOfBirth
            );
        emit AddUpdateHistoryUserManagementAdditionEven(
            keyToMove,
            historyUserManagementStructs[keyToMove].isLocked,
            historyUserManagementStructs[keyToMove].createdTime,
            historyUserManagementStructs[keyToMove].modifiedTime,
            historyUserManagementStructs[keyToMove].idCardNo,
            historyUserManagementStructs[keyToMove].idCardIssuePlace
            );
        emit AddUpdateHistoryUserManagementAdditionFlusEven(
            keyToMove,
            historyUserManagementStructs[keyToMove].phoneNumber,
            historyUserManagementStructs[keyToMove].job,
            historyUserManagementStructs[keyToMove].userAddr,
            rowToDelete);
        return rowToDelete;
    }

    function addGetUserHistory(address _userAddress) public view returns(
        address userAddress,
        string memory _userId,
        string memory _fullName,
        string memory _email,
        string memory _password,
        string memory _gender,
        string memory _dateOfBirth
        ){
        // if(!isUser(_userAddress)) revert('throw');
        return(
            _userAddress,
            historyUserManagementStructs[_userAddress].userId,
            historyUserManagementStructs[_userAddress].fullName,
            historyUserManagementStructs[_userAddress].email,
            historyUserManagementStructs[_userAddress].password,
            historyUserManagementStructs[_userAddress].gender,
            historyUserManagementStructs[_userAddress].dateOfBirth);
    }

    function addGetUserHistoryDetailMore(address _userAddress) public view returns(
        string memory _isLocked,
        string memory _createdTime,
        string memory _modifiedTime,
        string memory _idCardNo,
        string memory _idCardIssuePlace){
      // if(!isUser(_userAddress)) revert('throw');
        return(
            historyUserManagementStructs[_userAddress].isLocked,
            historyUserManagementStructs[_userAddress].createdTime,
            historyUserManagementStructs[_userAddress].modifiedTime,
            historyUserManagementStructs[_userAddress].idCardNo,
            historyUserManagementStructs[_userAddress].idCardIssuePlace);
    }

    function addGetUserHistoryDetailMoreMore(address _userAddress) public view returns(
        string memory _phoneNumber,
        string  memory  _job,
        string  memory  _userAddr,
        uint256 index){
        // if(!isUser(_userAddress)) revert('throw');
        return(
            historyUserManagementStructs[_userAddress].phoneNumber,
            historyUserManagementStructs[_userAddress].job,
            historyUserManagementStructs[_userAddress].userAddr,
            historyUserManagementStructs[_userAddress].index);
    }
